import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom'; // Asegúrate de importar Routes

import JavaIDE from './JavaIDE'; // Asegúrate de que la ruta a JavaIDE.jsx sea correcta
import Inicio from '.comp/Inicio'; // Asegúrate de que la ruta a Inicio.jsx sea correcta

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path="/javaide" element={<JavaIDE />} />
          <Route path="/" element={<Inicio />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
